collation.signatures:
The manuscript presents three distinct quire signatures which all coincide with one another (all of them are visible on f. 200r):
early signatures in brown ink, in Greek numerals from αον (f. 1r) to λθον (f. 304r), on lower corner of the first folio recto of all quires, lost or nearly lost on ff. 25r (δον), 33r (εον), 41r (ϛον), 137r (ιηον), 153r (κον), 161r (καον);
early signatures in brown ink, in Roman numerals, mostly lost in trimming but preserved on upper corner of ff. 17r (iii), 200r (xxvi), 208r (xxvii), 248r (xxxii);
modern signatures by Henry Bradshaw in pencil οn the lower corner of the first folio recto and a cross on the fifth: quires 1-23 a-i, k-u, x-z (lower-case); quires 24-39 A-I, K-P (upper-case).
